class Solution(object):

    def numDistinct(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: int
        """
        dp = []
        for i in range(len(s)+1):
            dp.append([0] * (len(t)+1))

        for i in range(len(s)+1):
            for j in range(len(t)+1):
                if j == 0:
                    dp[i][j] = 1
                elif i < j:
                    dp[i][j] = 0
                else:
                    if s[i-1] == t[j-1]:
                        dp[i][j] = dp[i-1][j] + dp[i-1][j-1]
                    else:
                        dp[i][j] = dp[i-1][j]
        return dp[len(s)][len(t)]



